        to Differential Equations\",\r\n    \"affiliation\" : \"Manchester Centre
        for Integrative Systems Biology and School of Computer Science, University
        of Manchester, Manchester Institute of Biotechnology, Manchester, UK\",\r\n
        \   \"synopsis\" : \"Genome-scale kinetic models of metabolism are important
