      string: "{\r\n  \"name\" : \"Hermansen2015 - denovo biosynthesis of pyrimidines
        in yeast\",\r\n  \"description\" : \"<notes xmlns=\\\"http://www.sbml.org/sbml/level2/version4\\\">
        \     <body xmlns=\\\"http://www.w3.org/1999/xhtml\\\">        <div class=\\\"dc:title\\\">Hermansen2015
        - denovo biosynthesis of pyrimidines in yeast</div>        <div class=\\\"dc:bibliographicCitation\\\">
        \         <p>This model is described in the article:</p>          <div class=\\\"bibo:title\\\">
        \           <a href=\\\"http://identifiers.org/pubmed/26511837\\\" title=\\\"Access
        to this publication\\\">Characterizing selective pressures on the pathway
        for de novo biosynthesis of pyrimidines in yeast. </a>          </div>          <div
        class=\\\"bibo:authorList\\\"> Hermansen RA , Mannakee BK , Knecht W , Liberles
        DA , Gutenkunst RN</div>          <div class=\\\"bibo:Journal\\\">BMC Evolutionary
        Biology. 2015, 15:232</div>          <p>Abstract:</p>          <div class=\\\"bibo:abstract\\\">
        \           <p>    Selection on proteins is typically measured with the assumption
        that each protein acts independently. However, selection more likely acts
        at higher levels of biological organization, requiring an integrative view
        of protein function. Here, we built a kinetic model for de novo pyrimidine
        biosynthesis in the yeast Saccharomyces cerevisiae to relate pathway function
        to selective pressures on individual protein-encoding genes.Gene families
        across yeast were constructed for each member of the pathway and the ratio
        of nonsynonymous to synonymous nucleotide substitution rates (dN/dS) was estimated
        for each enzyme from S. cerevisiae and closely related species. We found a
        positive relationship between the influence that each enzyme has on pathway
        function and its selective constraint.We expect this trend to be locally present
        for enzymes that have pathway control, but over longer evolutionary timescales
        we expect that mutation-selection balance may change the enzymes that have
        pathway control.     </p>          </div>        </div>        <div class=\\\"dc:publisher\\\">
        \         <p>This model is hosted on   <a href=\\\"http://www.ebi.ac.uk/biomodels/\\\">BioModels
        Database</a>  and identified by:   <a href=\\\"http://identifiers.org/biomodels.db/MODEL1512160000\\\">MODEL1512160000</a>.</p>
        \       <p>To cite BioModels Database, please use:   <a href=\\\"http://identifiers.org/pubmed/20587024\\\"
        title=\\\"Latest BioModels Database publication\\\">BioModels Database:  An
        enhanced, curated and annotated resource for published  quantitative kinetic
        models</a>.</p>    </div>    <div class=\\\"dc:license\\\">      <p>To the
        extent possible under law, all copyright and related or  neighbouring rights
        to this encoded model have been dedicated to  the public domain worldwide.
        Please refer to   <a href=\\\"http://creativecommons.org/publicdomain/zero/1.0/\\\"
        title=\\\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\\\">CC0
        \ Public Domain Dedication</a> for more information.</p>  </div></body></notes>\",\r\n
        \ \"format\" : {\r\n    \"name\" : \"SBML\",\r\n    \"identifier\" : \"SBML\",\r\n
        \   \"version\" : \"L2V4\"\r\n  },\r\n  \"publication\" : {\r\n    \"type\"
        : \"PubMed ID\",\r\n    \"accession\" : \"26511837\",\r\n    \"journal\" :
        \"BMC evolutionary biology\",\r\n    \"title\" : \"Characterizing selective
        pressures on the pathway for de novo biosynthesis of pyrimidines in yeast.\",\r\n
        \   \"affiliation\" : \"Department of Molecular Biology, University of Wyoming,
        Laramie, WY, 82071, USA. rhermans@uwyo.edu.\",\r\n    \"synopsis\" : \"<h4>Background</h4>Selection
        on proteins is typically measured with the assumption that each protein acts
        independently. However, selection more likely acts at higher levels of biological
        organization, requiring an integrative view of protein function. Here, we
        built a kinetic model for de novo pyrimidine biosynthesis in the yeast Saccharomyces
        cerevisiae to relate pathway function to selective pressures on individual
        protein-encoding genes.<h4>Results</h4>Gene families across yeast were constructed
        for each member of the pathway and the ratio of nonsynonymous to synonymous
        nucleotide substitution rates (dN/dS) was estimated for each enzyme from S.
        cerevisiae and closely related species. We found a positive relationship between
        the influence that each enzyme has on pathway function and its selective constraint.<h4>Conclusions</h4>We
        expect this trend to be locally present for enzymes that have pathway control,
        but over longer evolutionary timescales we expect that mutation-selection
        balance may change the enzymes that have pathway control.\",\r\n    \"year\"
