      string: "{\r\n  \"name\" : \"Novak1998 - Mathematical model of fission yeast
        cell cycle\",\r\n  \"description\" : \"<notes xmlns=\\\"http://www.sbml.org/sbml/level2/version4\\\">
        \     <body xmlns=\\\"http://www.w3.org/1999/xhtml\\\">        <pre>Mathematical
        model of the fission yeast cell cycle with checkpointcontrols at the G1/S,
        G2/M and metaphase/anaphase transitions. Model encoded  by Matthieu Maire
        and submitted to BioModels by Krishna kumar Tiwari.</pre>      </body>    </notes>\",\r\n
        \ \"format\" : {\r\n    \"name\" : \"SBML\",\r\n    \"identifier\" : \"SBML\",\r\n
        \   \"version\" : \"L2V4\"\r\n  },\r\n  \"publication\" : {\r\n    \"type\"
        : \"PubMed ID\",\r\n    \"accession\" : \"9652094\",\r\n    \"journal\" :
        \"Biophysical chemistry\",\r\n    \"title\" : \"Mathematical model of the
        fission yeast cell cycle with checkpoint controls at the G1/S, G2/M and metaphase/anaphase
        transitions.\",\r\n    \"affiliation\" : \"Department of Agricultural Chemical
        Technology, Technical University of Budapest, Hungary. bnovak@chem.bme.hu\",\r\n
        \   \"synopsis\" : \"All events of the fission yeast cell cycle can be orchestrated
        by fluctuations of a single cyclin-dependent protein kinase, the Cdc13/Cdc2
        heterodimer. The G1/S transition is controlled by interactions of Cdc13/Cdc2
        and its stoichiometric inhibitor, Rum1. The G2/M transition is regulated by
        a kinase-phosphatase pair, Wee1 and Cdc25, which determine the phosphorylation
        state of the Tyr-15 residue of Cdc2. The meta/anaphase transition is controlled
        by interactions between Cdc13/Cdc2 and the anaphase promoting complex, which
        labels Cdc13 subunits for proteolysis. We construct a mathematical model of
        fission yeast growth and division that encompasses all three crucial checkpoint
        controls. By numerical simulations we show that the model is consistent with
        a broad selection of cell cycle mutants, and we predict the phenotypes of
        several multiple-mutant strains that have not yet been constructed.\",\r\n
