      string: "{\r\n  \"name\" : \"Stanford2013 - Kinetic model of yeast metabolic
        network (regulation)\",\r\n  \"description\" : \"<notes xmlns=\\\"http://www.sbml.org/sbml/level2/version4\\\">
        \     <body xmlns=\\\"http://www.w3.org/1999/xhtml\\\">        <div class=\\\"dc:title\\\">Stanford2013
        - Kinetic model of yeast metabolic network (standard)</div>            <div
        class=\\\"dc:description\\\">      <p>Large-scale model construction based
        on a logical layering of data such as reaction fluxes, metabolite concentrations,
        and kinetic constants. This model is built with regulatory information.</p>
        \               </div>            <div class=\\\"dc:bibliographicCitation\\\">
        \     <p>This model is described in the article:</p>                <div class=\\\"bibo:title\\\">
        \       <a href=\\\"http://identifiers.org/pubmed/24324546\\\" title=\\\"Access
        to this publication\\\">Systematic construction of kinetic models from genome-scale
        metabolic networks.</a>                    </div>                <div class=\\\"bibo:authorList\\\">Stanford
        NJ, Lubitz T, Smallbone K, Klipp E, Mendes P, Liebermeister W.</div>                <div
        class=\\\"bibo:Journal\\\">PLoS ONE 2013; 8(11): e79195</div>                <p>Abstract:</p>
        \               <div class=\\\"bibo:abstract\\\">        <p>The quantitative
        effects of environmental and genetic perturbations on metabolism can be studied
        in silico using kinetic models. We present a strategy for large-scale model
        construction based on a logical layering of data such as reaction fluxes,
        metabolite concentrations, and kinetic constants. The resulting models contain
        realistic standard rate laws and plausible parameters, adhere to the laws
        of thermodynamics, and reproduce a predefined steady state. These features
        have not been simultaneously achieved by previous workflows. We demonstrate
        the advantages and limitations of the workflow by translating the yeast consensus
        metabolic network into a kinetic model. Despite crudely selected data, the
        model shows realistic control behaviour, a stable dynamic, and realistic response
        to perturbations in extracellular glucose concentrations. The paper concludes
        by outlining how new data can continuously be fed into the workflow and how
        iterative model building can assist in directing experiments.</p>                    </div>
        \               </div>            <div class=\\\"dc:publisher\\\">      <p>This
        model is hosted on        <a href=\\\"http://www.ebi.ac.uk/biomodels/\\\">BioModels
        Database</a>            and identifiedby:        <a href=\\\"http://identifiers.org/biomodels.db/BIOMD0000000497\\\">BIOMD0000000497</a>
        \           .        </p>                <p>To cite BioModels Database, please
        use:        <a href=\\\"http://identifiers.org/pubmed/20587024\\\" title=\\\"Latest
        BioModels Database publication\\\">BioModels Database: An enhanced, curated
        and annotated resourcefor published quantitative kinetic models</a>            .
        \       </p>                </div>            <div class=\\\"dc:license\\\">
